import React, { Component } from 'react';
import '../App.css';
import Axios from 'axios';

class Detail extends Component {
  render() {
    return (
        <div className='detail-content'>
           <Grid>
              <Row >

                <Col xs={12} md={2} className='p-b-20'>
                    <img 
                    alt='img'
                    src={'https://image.tmdb.org/t/p/w500/v1BUGs66ga9btyV4DCQPpmIVuu8.jpg'}
                    width='100%'
                    height={250}
                    />
                </Col>
              </Row>  
              </Grid>
        </div>
    );
  }
}

export default Detail;
